TextEquiv.Unicode:
On note, parmi les plus en vue :
Pétigny, de Tours, détenteur du titre
fédéral 38 ; et son camarade Fusey ;

Les vieux, ne peuvent plus attendre;
ils veulent une retraite leur permettant
de vivre décemment.

Région ouest, début de septembre;
Région nord, 13 septembre;
Région sud, 15 septembre;
Région est, 27 septembre.
